import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import './Contact.css';

const Contact = () => {
    return (
        <div>
            <Container>
                <div className="text-center">
                    <h2 className="title">Contact Me</h2>
                </div>
                <Row>
                    <Col md={4}>
                        <div className="contact-div">

                        </div>
                    </Col>
                </Row>
            </Container>
        </div>
    );
};

export default Contact;
